Answer.18844:
ولا تدري قد يكون أعظم ما تقدمهُ لإنسان تستمع إليه أن تُطمئنَهُ..أن تخبره أن لا شيء يستحق ، وأن جماله لا يحق لمكدرات الحياة أن تعبث بقُدسيته ، أن تشعره بأن جيش الظروف الذي يحاصره لن يستمر طويلًا على معابر قلبه ، أن تخبره بأن تفاصيل وجهه البهية ما خُلقت لتذبل ، أن تحضن بوحَهُ ، وأن تذهب عنه الروع ، والخوف والفزع من قلبه..

{ فلمَّا جاءهُ وقصَّ عليهِ القصص ؛ قال: لاتَخفْ }

ما جاءك لتقاتل معه ، جاء يطلب منك أن تضع خنجرك في قلب خوفه ?
